import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import AppRouter from './routes/AppRouter';
import configureStore from './store/store.js';
import { addExpense } from './actions/expenses.js';

const store = configureStore();
store.dispatch(addExpense({ id: 1, name: 'Expense 1', description: 'Description 1', createdAt: 0}));
store.dispatch(addExpense({ id: 2, name: 'Expense 2', description: 'Description 2', createdAt: 0}));
store.dispatch(addExpense({ id: 3, name: 'Expense 3', description: 'Description 3', createdAt: 0}));
store.dispatch(addExpense({ id: 4, name: 'Expense 4', description: 'Description 4', createdAt: 0}));

ReactDOM.render(<AppRouter />, document.getElementById('root'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
